a._function:
__ht__function(data, gv, cache, inputs) {if(typeof editor == "undefined") return; //240801，如果内嵌编辑器还没加载完毕，避免报错！

let paletteItems = [],
    folderNodetmp = editor.displays.dataModel._dataMap['displays/demo/' + ['2-模板','3-示例'][inputs - 1]], //240516，注意，索引减1要，因为0是文件！
    childrentmp = folderNodetmp && folderNodetmp.getChildren();
//tips，抽屉只显示第一层目录下第二层的文件，形成抽屉，其他不满足条件的均不显示！
if([1,2].indexOf(inputs) !== -1){
    //240518，如果初始没有打开的页面，切换到模板、示例时，就直接展开到全屏而不是左侧一列！
    if(!editor.gv) editor.leftSplitView.setStatus('cr');
    else if(editor.leftSplitView.getStatus() == 'cr'){
        editor.leftSplitView.setStatus('normal');
    }
    childrentmp && childrentmp.toArray().forEach(item=>{
        if(item.fileType === 'dir'){
            paletteItems.push({
                title: item.url && item.url.split('/').at(-1),
                children: (()=>{
                    let childs = [];
                    item.getChildren().toArray().forEach(child=>{
                        let isJsonType = child.getId().slice(-5) === '.json';
                        //要求是json文件，如果不是，那么必须当前是资源展示！
                        if(child.fileType !== 'dir' && isJsonType){
                            //.json的只保留文件名，.jpg、.png、.mp3等格式的资源文件，包括后缀也一并显示！
                            let texttmp = isJsonType ? child.url && child.url.split('/').at(-1).slice(0,-5) : child.url && child.url.split('/').at(-1),
                                iconName = child.getId().slice(0,-5),
                                iconImgPng = iconName + '.png',
                                iconImgJpg = iconName + '.jpg', //240518，jpg格式如果有，那么就用其展示到模板、示例的缩微图中，因为png后缀的图片，随着编辑时保存，会自动更新被替换掉！
                                hasJpg = editor.displays.list.dm()._dataMap[iconImgJpg],
                                iconChoosed = hasJpg ? iconImgJpg : iconImgPng; //240518，默认选择png格式，如果资源有jpg格式的，那么久显示jpg的！
                            //240520，染色一下，这样不同颜色的图片，在示例列表格子中，显得更好看，不会颜色跳跃杂乱！！
                            let imgDrawed = new ht.ui.drawable.ImageDrawable(isJsonType ? iconChoosed : child.getId(), 'uniform');  //显示图标！用png来显示，而不是.json，否则是渲染元素组件拖放运行后的效果而不是图片效果了！
                            imgDrawed.setColorTint('rgba(240,245,255)');
                            childs.push({
                                text: texttmp,
                                toolTip: texttmp,
                                icon: child.getId(),    //240514，用于拖放到编辑器后实例化的！
                                //注意，这里抽屉分组，对于音视频等非图片文件暂未支持图片预览！目前的处理时间，json和非json，前者强制用.png格式的文件显示，后者直接显示文件本身！
                                iconDrawable: imgDrawed
                            });
                        }
                    });
                    return childs;
                })()
            });
        }
    });
}else if(editor.leftSplitView.getStatus() == 'cr'){
    //240518，如果初始没有打开的页面，切换到模板、示例时，就直接展开到全屏而不是左侧一列！
    editor.leftSplitView.setStatus('normal');
}

//240519，切换左侧菜单栏选项时，如果此前是关闭状态，那么需要打开！
if(editor.leftSplitView.getStatus() == 'cl'){
    editor.leftSplitView.setStatus('normal');
}

if(paletteItems.length){
    editor.leftTopTabView.select(6);
    editor.leftTopTabView.setTabHeight(0);
    let palettetmp = editor.leftTopTabView.get(6).getView();
    palettetmp.setItems(paletteItems);
    try{
        palettetmp.getTemplateButton().setPreferredSize(220,175)
    }catch(e){
    }
    palettetmp.getTemplateButton().setIconWidth(210)
    palettetmp.getTemplateButton().setIconHeight(140)
    palettetmp.getTemplateButton().setMargin(0)
    palettetmp.getTemplateButton().setBackground('rgb(47,55,70,0.5)');  //默认背景色，因为每个页面不一样，避免整体看起来很凌乱没有边界感！
}else if(inputs === 0){
    editor.leftTopTabView.select(1);
    //240518，如果初始没有默认选中文件，那么久指定初始默认位置！
    if(editor.displays.list.sm().getSelection().toArray().length == 0) _i.editorLocateFile('displays/demo/1-学习/');
}

return paletteItems;}
